		static void InternalInitialize()
		{
		}

		public static void Initialize()
		{
			if (s_initialized != 2)
				if (global::System.Threading.Interlocked.CompareExchange(
									ref s_initialized, 
									1, 
									0
								) == 0)
				{
					InternalInitialize();
					global::System.Threading.Volatile.Write(
										ref s_initialized, 
										2
